          <Col md={{ span: 6, offset: 6 }}>MY TRIP</Col>
        </Row>
      </Container>

      <Row background-color="red">
        {/* <Col xs="6" sm="4">
          gdf
        </Col> */}
        <Col xs="6" sm="4">
          Description venu:
